import { useSelector } from 'react-redux'


function Cart() {

    let cartItems = useSelector((state)=>{
        state.cartItems
    })

    console.log(cartItems)

  return (
    <div>
        <h2 style = {{textAlign : "center"}}>Cart</h2>
    </div>
  )
}

export default Cart
